import React from 'react';
import author1 from './resource/author1.jpeg';
import { Image } from 'react-bootstrap';

export default function ImageHolder(props) {
    function returnImage() {
        let image = '';
        switch (props.id) {
            case '1':
                image = <Image src={author1} rounded />
                break;
            case '2':
                image = <Image src={author2} rounded />
                break;
            case '3':
                image = <Image src={author3} rounded />
                break;
            case '4':
                image = <Image src={author4} rounded />
                break;
            case '5':
                image = <Image src={author5} rounded />
                break;
            case '6':
                image = <Image src={author6} rounded />
                break;
            default:
                image = <Image alt="Invisible man" rounded />

        }
        return image;
    }
    return (
        <div>
            {
                returnImage()
            }
        </div>
    );
}
